import Header from '../components/Header'
import Body_setting from '../components/Body/Body_setting'
const Setting = () => {
  const socket = useSelector((state) => state.socket.socket);
  console.log(socket);
  return (
    <div>
      <Header />
      <Body_setting />
    </div>
  )
}

export default Setting
